import Core from './Core.js';
import Geometry from './Geometry.js';
import Legacy from './Legacy.js';
import Misc from './Misc.js';
import XML from './XML.js';

var IO = {
  Core: Core,
  Geometry: Geometry,
  Legacy: Legacy,
  Misc: Misc,
  XML: XML
};

export { IO as default };
